<script>

 window.onload = function() {
  
  
  document.getElementById('msgCorreo').style.display='none';
  document.getElementById('msgContrasena').style.display='none';

 
}

function focusCorreo()
{
  var correo = document.getElementById("txtCorreo");
  
    if (correo.value.length <=0) {
    document.getElementById('msgCorreo').style.display='block';
 
   }
   else
   {
    document.getElementById('msgCorreo').style.display='none';
   }
 }
 function focusPassword()
{
  var passw = document.getElementById("txtPassword");
  
    if (passw.value.length <=0) {
    document.getElementById('msgContrasena').style.display='block';
 
   }
   else
   {
    document.getElementById('msgContrasena').style.display='none';
   }
 }

function validar(){
  
   var correo=document.getElementById("txtCorreo").value
   var pass=document.getElementById("txtPassword").value
   var cant=0;
   if (correo.length <=0) {
    document.getElementById('msgCorreo').style.display='block';
    cant=cant+1;
   }
   else
   {
    document.getElementById('msgCorreo').style.display='none';
   }
   if (pass.length <=0) {
    document.getElementById('msgContrasena').style.display='block';
    cant=cant+1;
   }
   else
   {
    document.getElementById('msgContrasena').style.display='none';
   }
   if(cant==0)
   {
    window.open('./consolidada.html',"_self");
   }
 
} 
</script>
